window.bookSummaryJSON = "<p>The epic third story in the #1 New York Times bestselling Court of Thorns and Roses series by Sarah J. Maas.<br> <br> Feyre has returned to the Spring Court, determined to gather information on Tamlin's actions and learn what she can about the invading king threatening to bring her land to its knees. But to do so she must play a deadly game of deceit. One slip could bring doom not only for Feyre, but for everything-and everyone-she holds dear.<br> <br> As war bears down upon them all, Feyre endeavors to take her place amongst the High Fae of the land, balancing her struggle to master her powers-both magical and political-and her love for her court and family. Amidst these struggles, Feyre and Rhysand must decide whom to trust amongst the cunning and lethal High Lords, and hunt for allies in unexpected places.<br> <br> In this thrilling third audiobook in the #1 New York Times bestselling series from Sarah J. Maas, the fate of Feyre's world is at stake as armies grapple for power over the one thing that could destroy it.<br> <br> Performed by Melody Muze, Anthony Palmini, Gabriel Michael, Jon Vertullo, Nora Achrati, Amanda Forstrom, Henry W. Kramer, Shawn K. Jain, Megan Dominy, Natalie Van Sistine, Stephanie Németh-Parker, Ryan Haugen, Debi Tinsley, Troy Allan, Matthew Bassett, Karenna Foley, Michael John Casey, Yasmin Tuazon, Eric Messner, Karen Novack, Bradley Foster Smith, Ann Flandermeyer, and Christopher Williams.</p>"; 
